INSERT INTO `outbreak_events` (`id`, `outbreak_name`, `outbreak_type`, `start_date`, `end_date`, `description`, `affected_regions`, `severity_level`, `status`, `response_level`, `coordinator_name`, `contact_email`, `contact_phone`, `priority`, `created_at`, `updated_at`) VALUES
(1, 'Mpox', 'viral', '2024-08-13', '0000-00-00', 'Mpox is a viral zoonotic disease that occurs primarily in tropical rainforest regions of Central and West Africa. The disease is transmitted from animals to humans, with rodents and primates being the most common sources. Human-to-human transmission also occurs through close contact with an infected person\'s bodily fluids, skin lesions, or contaminated materials. Recent outbreaks have been reported in several African countries, and cases have also been detected in non-endemic regions, raising global concern. Symptoms typically include fever, rash, swollen lymph nodes, muscle aches, and fatigue. Though mpox is generally less severe than smallpox, complications can arise. Public health authorities are working to contain its spread by isolating cases, promoting preventive hygiene, and providing vaccination where available. The focus remains on raising awareness and enhancing surveillance to prevent further outbreaks.', 'Central Africa, West Africa,Eastern Africa, Northern Africa, Southern Africa', 'moderate', 'active', 'regional', 'MIS & Mr.Joshua Nyarango\n', 'mis@africacdc.org;NyarangoJ@africacdc.org', '+251974531808', 1, '2024-10-06 23:42:00', '2024-10-17 11:03:10'),
(4, 'Marburg', 'Viral', '2024-11-15', '0000-00-00', '', 'Eastern Africa', 'low', 'active', 'local', '', '', '', NULL, '2025-02-10 09:36:18', '2025-02-10 22:48:01');
